export default function Reset() {

    const [inputData,setInputData] = useState()

    function handleChange (event) {
        const {value} = event.target
        setInputData(value)
        
    }
    return (
        <form>
            <input 
                type='text'
                name='emailOrPhone'
                value = {inputData}
            />

        </form>
  )
}
